WOW Frank.  I&#39;m so sorry you have to go through all this.  I know many
people respect you for all that you have done and continue to do!  I wish I
could do or say something to make it all stop but I can&#39;t.  My only advise -
Do what you love and *%#* the rest.

Huge hugs from Texas!  

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Frank Sumption
Sent: Wednesday, December 12, 2007 2:23 PM
To: Group
Subject: [EVP-ITC] Afeter a long discussion...



 After a long discussion, and at times a yelling match with Chris Moon on
the phone...I have like zero memory for verbal stuff, basically I think it
came down to he said-she said type deal. I could agree with some of what Mr
Moon said, but the bottom line is--I don&#39;t care! I have had enough of these
endless pissing contests, one person telling me one thing, someone else
telling me something else. I&#39;m not wise enough to tell who is telling the
truth. I&#39;m done, I&#39;m not discussing this stuff anymore, I&#39;m not making boxes
anymore. I have absolutely no interest in the so called paranormal. I don&#39;t
sell this shit, I don&#39;t make any money, all it does eat all my time and piss
me off. I&#39;ll finish this last box I&#39;m working on, and that&#39;s it. No more
e-mails, no more discussion--I have had it!

 Mr Moon said he would be glad to come on the group and answer question--so
there ya go, now is your chance. I&#39;m not going to be the go between, nor
will I participate. 

 Frank-S

  _____  

Don&#39;t get caught with egg on your face. Play Chicktionary! Check it out!
&lt;http://club.live.com/chicktionary.aspx?icid=chick_wlhmtextlink1_dec&gt;  




